const teacher = [
    {
        path: "/teacher",
        component: () => import("../layouts/teacher.vue"),
        children: [
            {
                path: "profile",
                name: "teacher-profile",
                component: () => import ("../pages/teacher/teacher-profile.vue")
            },
        ]
    }
];

export default teacher;
